import secrets

def get_initials():
    prime = int(get_prime(),16)
    base = calculate_safe_base(prime)
    return prime,base


def get_private_key():
    randbits = secrets.randbits(600)
    randbits = int(randbits)
    randbits_str = str(randbits).zfill(600)
    return randbits_str


def calculate_safe_base(prime):
    base = 2 # The smallest safe base is 2
    while not is_safe_generator(base, prime):
        base += 1
    return base

def is_safe_generator(base, prime):
    safe_boundary = (prime - 1) // 2
    # Calculate the order of the base modulo prime
    order = pow(base, safe_boundary, prime)
    if order == 1:
        return False
    elif order == prime - 1:
        return True
    else:
        return False

